camente. Isto \u00e9, existe um algoritmo que captura os dados do minist\u00e9rio da sa\u00fade e de mobilidade, e realiza as predi\u00e7\u00f5es de forma autom\u00e1tica, sem a interven\u00e7\u00e3o humana. Isto significa que, devido a particularidades dos estados quanto a coleta de informa\u00e7\u00f5es e outros fatores, as predi\u00e7\u00f5es podem n\u00e3o representar corretamente a evolu\u00e7\u00e3o das vari\u00e1veis. Por isso, essas informa\u00e7\u00f5es devem ser analisadas com cuidado e de forma cr\u00edtica."},"id":"96084","type":"Paragraph"},{"attributes":{},"id":"94595","type":"UnionRenderers"},{"attributes":{"text":"&lt;select id=\"16131\" onchange=\"location = this.value;\"&gt;&lt;option value=\"\"&gt;Selecione uma das Op\u00e7\u00f5es a Seguir&lt;/option&gt;&lt;option value=\"Norte.html\"&gt;Estados do Norte&lt;/option&gt;&lt;option value=\"Nordeste.html\"&gt;Estados do Nordeste&lt;/option&gt;&lt;option value=\"Sul.html\"&gt;Estados do Sul&lt;/option&gt;&lt;option value=\"Suldeste.html\"&gt;Estados do Suldeste&lt;/option&gt;&lt;option value=\"Centro-Oeste.html\"&gt;Estados do Centro-Oeste&lt;/option&gt;&lt;option value=\"AiL_An.html\"&gt;Estado do Alagoas&lt;/option&gt;&lt;option   value=\"BiA_An.html\"&gt;Estado da Bahia&lt;/option&gt;&lt;option   value=\"CiE_An.html\"&gt;Estado do Cear\u00e1&lt;/option&gt;&lt;option   value=\"MiA_An.html\"&gt;Estado do Maranh\u00e3o&lt;/option&gt;&lt;option   value=\"PiB_An.html\"&gt;Estado da Para\u00edba&lt;/option&gt;&lt;option   value=\"PiE_An.html\"&gt;Estado de Pernambuco&lt;/option&gt;&lt;option   value=\"PiI_An.html\"&gt;Estado do Piau\u00ed&lt;/option&gt;&lt;option   value=\"RiN_An.html\"&gt;Estado do Rio Grande do Norte&lt;/option&gt;&lt;option   value=\"SiE_An.html\"&gt;Estado de Sergipe&lt;/option&gt;&lt;option   value=\"RiO_An.html\"&gt;Estado de Rond\u00f4nia&lt;/option&gt;&lt;option   value=\"AiC_An.html\"&gt;Estado do Acre&lt;/option&gt;&lt;option   value=\"AiM_An.html\"&gt;Estado do Amazonas&lt;/op
